import React, { useEffect } from 'react'
import sellerProfileAction from '../Store/Action/SellerProfileAction'
import { useDispatch, useSelector } from 'react-redux'

const SellerProfile = (props) => {
    console.log(props.id)
    const dispatch = useDispatch()
    // const data = useSelector(state => state.ProductPageReducer?.ProductPageData)
    useEffect(() => {
        sellerProfileAction(dispatch, { sellerId: props.id })
    }, [dispatch])
    const SellerData = useSelector(state => state.SellerProfileReducer.SellerProfileData)
    console.log(SellerData)

    return (
        <>
            <div>
                <h4>About The Seller</h4>
                <img src="https://inszn-ecom.s3.amazonaws.com/76b64ec4-f6c4-4b4a-8169-cc38037a75c5.jpg" alt="seller1234"/>
                <a href="/seller/620c8f991c64873137477700">Jessica seller</a>
                <div class="follow-txt-info"><div class="follow-txt"><span class="total">3</span><span class="txt" style="cursor: pointer;">Followers</span></div><div class="follow-txt"><span class="total">2</span><span class="txt" style="cursor: pointer;">Following</span></div></div>
                <p>Rating :</p>
            </div>
        </>
    )
}

export default SellerProfile
